// src/utils/TimeUtils.js
export const isRestrictedTime = () => {
    const currentHour = new Date().getHours();
    console.log('Current Hour : ', currentHour); // Debugging log
    const restricted = currentHour >= 18 || currentHour < 6;
    console.log('Is Restricted Time : ', restricted); // Debugging log
    return restricted;
};
